import React, { useState } from "react";
import { NavbarContainer, NavLogo, Nav } from "./styling/Navbar.styled";
import { FaBars } from "react-icons/fa";

export const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>Axios.io</NavLogo>
          <MobileIcon>
            <FaBars />
          </MobileIcon>
          <NavMenu>
            <NavItem>
              <NavLinks></NavLinks>
            </NavItem>
          </NavMenu>
        </NavbarContainer>
      </Nav>
    </>
  );
};
